import React, { useState } from "react";
import { Upload, Button, message, Row } from "antd";
import { UploadOutlined } from "@ant-design/icons";
import TextArea from "antd/es/input/TextArea";

const P1 = () => {
  const [loading, setLoading] = useState(false);
  const [textareaContent, setTextareaContent] = useState("");
  const [textareaContent2, setTextareaContent2] = useState("");

  const handleTextareaChange = (e) => {
    setTextareaContent(e.target.value);
  };

  const handleButtonClick = () => {
    console.log("Textarea content:", textareaContent);
    setTextareaContent2(textareaContent);
  };

  return (
    <div>
      <br />

      <div id="a1">{textareaContent2}</div>
      <br />
      <br />
      <br />
      <br />
      <TextArea
        value={textareaContent}
        onChange={handleTextareaChange}
        placeholder="Enter some text here"
        autoSize={{ minRows: 3, maxRows: 5 }}
      />
      <Row justify="end">
        <Button>向前</Button>
        <Button>向后</Button>
        <Button onClick={handleButtonClick}>上传</Button>
      </Row>
    </div>
  );
};

export default P1;
